INSERT INTO `privacy_policy` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Privacy Policy', '<p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">Introduction</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">Welcome to Tribal! We value your privacy and are committed to protecting your personal information. This Privacy Policy explains how we collect, use, and safeguard your data when you use our app and services.</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">1. Information We Collect</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">We may collect the following types of information:</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Personal Information: Information that can identify you, such as your name, email address, contact details, and account preferences.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Usage Data: Data on how you interact with Tribal, including features used, content viewed, and time spent on the app.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Device Information: Information about the device you use to access Tribal, like your device ID, IP address, operating system, and browser type.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Location Data: If you permit, we may collect your approximate location to tailor our services.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">2. How We Use Your Information</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">We use the collected data for the following purposes:</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>To Provide and Improve Our Services: Personalize your experience, optimize our app, and ensure efficient technical support.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>To Communicate with You: Send notifications, updates, marketing messages (with your consent), and respond to your inquiries.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>To Ensure Security: Detect, investigate, and prevent security incidents or fraud.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>To Comply with Legal Obligations: Fulfill legal and regulatory requirements applicable to our services.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">3. Sharing Your Information</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">We do not sell your personal information. However, we may share your information with:</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Service Providers: Third-party vendors who help us run and improve our services (e.g., hosting, analytics, customer support).</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Affiliates and Business Partners: If necessary for joint operations or promotional efforts.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Legal Authorities: When required by law or in response to legal processes.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">4. Data Security</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">We implement various security measures to protect your personal information from unauthorized access, disclosure, alteration, or destruction. However, no method of transmission over the internet or electronic storage is 100% secure.</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">5. Your Rights and Choices</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">Depending on your location, you may have certain rights regarding your personal data, including:</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Access and Correction: Request access to or correction of your personal data.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Data Portability: Obtain a copy of your data in a structured, machine-readable format.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Deletion: Request deletion of your personal data (subject to legal exceptions).</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span><span style=\"white-space:pre\">	</span>Opt-Out: Opt-out of marketing communications or limit certain data-sharing practices.</span></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">To exercise these rights, please contact us at [Your Contact Email].</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">6. Childrens Privacy</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">Our services are not intended for children under 13. We do not knowingly collect personal data from children under this age. If we discover weve collected information from a child under 13, we will delete it promptly.</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">7. International Data Transfers</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">Tribal operates globally. When transferring your data outside your home country, we ensure appropriate safeguards are in place to protect your privacy.</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">8. Changes to This Privacy Policy</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">We may update this policy from time to time. Any changes will be posted within the app, and you will be notified of significant updates. Your continued use of Tribal signifies acceptance of the revised policy.</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">9. Contact Us</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">If you have any questions about this Privacy Policy or how we handle your data, please contact us at:</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">[Your Contact Email Address]</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">[Business Address]</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">[Phone Number, if applicable]</font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\"><br></font></p><p style=\"line-height: 1.6;\"><font color=\"#555555\" face=\"Arial, sans-serif\" size=\"3\">This draft is compliant with general standards, but consider a legal review to address any additional region-specific requirements or special data processing situations Tribal may have.</font></p>', '2025-01-16 04:55:48', '2024-12-21 12:30:48');
